import { useState } from 'react';
// import './temp.css';
function FetchApi() {
    const [pi, spi] = useState("");
    const [pd, spd] = useState({});

    function print() {
        fetch(`https://api.openweathermap.org/data/2.5/weather?q=${pi}&appid=${'69a33d4e32ce897f1db90f15898387f6'}&units=metric`).
            then(response => response.json()).
            then(data => spd(data)).
            catch(error => console.log(error));
        console.log(pd)
    }
    const handle = (e) => {
        spi(e.target.value);
    }
    return (
        <div className="Form">
            <h1>Temperature</h1>
            <form class="row g-3">
                <div class="col-auto">
                    <input type="text" class="form-control" id="staticEmail2" onChange={handle} value="Enter city name"/>
                </div>
                <div class="col-auto">
                    <button type="submit" onClick={print} class="btn btn-primary mb-3">Submit</button>
                </div>
            </form>

            {pd && (
                <div>
                    <p>Temp : {pd.main && pd.main.temp}</p>
                </div>
            )}
        </div>
    )
}
export default FetchApi;
